import React, {Component} from 'react';
import {Navbar, FormControl,Button, Nav, Form} from 'react-bootstrap';
import { Card } from 'antd';
import 'antd/dist/antd.css'
class Categories extends Component {
    render(){
        return (
            <div style = {{width: '100%', margin: 'auto'}}>
                <Navbar bg="primary" variant="dark">
    <Navbar.Brand href="#home">Find The Contractor For You</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-light">Search</Button>
    </Form>
  </Navbar>
  <div class = 'box-container'>


  <div id= 'image_1' className = 'Images'>
  <Card
    hoverable
    style={{ width: 240 }}
    cover={<img alt="example" src="https://dyj7luh3166cu.cloudfront.net/wp-content/uploads/sites/6/2016/10/roll-and-repeat.jpg" />}
  >
    <Card title="Painting" description="www.instagram.com" />
  </Card>,
 

  </div>
  <div id= 'image_2' className = 'Image2'>

  <Card
    hoverable
    style={{ width: 240 }}
    cover={<img alt="example" src="https://www.dh-asia.com/wp/wp-content/uploads/2015/11/photodune-12678126-worker-mopping-floor-in-kitchen-s.jpg" />}
  >
    <Card title="House Cleaning" description="www.instagram.com" />
  </Card>,
 

  </div>
  <div id = 'image_3' className = 'Image3'>

  <Card
    hoverable
    style={{ width: 240 }}
    cover={<img alt="example" src="https://promiseelectric.com/wp-content/uploads/2019/07/tool-2766835_1920.jpg" />}
  >
    <Card title="Electrical" description="www.instagram.com" />
  </Card>,
  
  </div>
  </div>

            </div>
        )
    }
}

export default Categories;
